long_string = ""
c = "AATG"
d = "TATC"
z = 0
a = 50

for i in range(2):
    if i == 0:
        x = c
    else:
        x = d
    while (a > 0):
        try:
            long_index = 0
            lc = long_string.index(x)
            long_index += lc
            long_string = long_string[lc + 4:]
            if long_index == 0:
                z = z + 1
            a -=1
        except:
            break
    print(f"count:{z+1}")

